/// <summary>
/// The <c>WHSApplicationInsightsEventIds</c> class contains the IDs all available warehouse related events in the Application Insights telemetry.
/// </summary>
/// <remarks>
/// The IDs must be unique.
/// The WHS prefix should always be used.
/// The numerical part should be increased by 1 for each new event ID.
/// New event IDs should be added at the end, so it is kept sorted.
/// </remarks>
internal static final class WHSApplicationInsightsEventIds
{
    internal static const str LocationDirectiveFindLocation = 'WHS000001';
    internal static const str WaveProcessingPostWave = 'WHS000002';
    internal static const str MobileAppNextPageRequest = 'WHS000003';
    internal static const str MobileAppImageRequest = 'WHS000004';
    internal static const str WorkCreationLog = 'WHS000005';
    internal static const str MobileAppRoundTrip = 'WHS000006'; // Used in the WMA repo, to log device-related telemetry when WMA receives a server response.
    internal static const str WaveProcessingCreateWork = 'WHS000007';
    internal static const str WaveProcessingCreateLoads = 'WHS000008';
    internal static const str WaveProcessingProcessWaveMethods = 'WHS000009';
    internal static const str WaveProcessingValidateWave = 'WHS000010';
    internal static const str WaveProcessingAllocateWave = 'WHS000011';
    internal static const str WaveProcessingContainerization = 'WHS000012';
    internal static const str LoadPosting = 'WHS000013';
